def drawKpts(imgs, kpts):
    # print len(kpts[0])
    # print len(kpts[0][0])
    for i in range(len(imgs)):
        img_ = imgs[i]
        img = np.copy(img_)
        # print len(kpts[i])
        # kp, des = kpts[i]
        # print
        for j in range(0, len(kpts[i][0]), 10):
            kp = kpts[i][0][j]
            cv2.circle(img, tuple(map(int, kp.pt)), 20, (0, 255, 255), 4)
        img2 = cv2.pyrDown(img)
        img2 = cv2.pyrDown(img2)
        cv2.imshow("asd", img2)
        cv2.waitKey()


